import React from 'react';
import './Card.css';
import logo from '../Image/logo.png'; 


class Card extends React.Component {

    render() {
        return (
            <div className="card">
                <img className="card-image" src={logo} alt="Avatar"/>   
                <div className="borderline"/>                          
                <div className="card-container">            
                    <p className="card-container-item">Turbidity Sensor Offline</p> 
                </div>
            </div>
        );
    }
}

export default Card;
